import React, { Component } from "react";
import Base from "../core/Base";

export default class chumma extends Component {
  constructor(props) {
    super(props);
    this.state = {
      radio: "",
    };
  }
  activity = () => {
    return (
      <div>
        <h4>
          Select Task : <input type="radio" value="Male" name="radio" />{" "}
          Activity
          <input type="radio" value="Female" name="radio" /> Waiting
        </h4>
      </div>
    );
  };

  render() {
    return (
      <Base title="" description="" className="container-fluid bg-light p-4">
        <div className="text-center">{this.activity()}</div>
      </Base>
    );
  }
}
